import logo from './logo.svg';
import './App.css';

import { BrowserRouter as Router, Route } from 'react-router-dom';
import index from './paginacion/index';
import Rutas from './paginacion/Rutas';
import Login from './paginacion/Login';
import Registro from './paginacion/Registro';


function App() {
  return (
    <div className="App">
      <h1>RUTAS</h1>
      <Router>
        <Route path='/'  Component={ Rutas} />
          {/* <Route path='/home' Component={ index }></Route>
          <Route path='/login' Component={ Login  }></Route>
          <Route path='/registro' Component={ Registro }></Route> */}
      </Router>
    </div>
  );
}

export default App;
